actionConfiguration.body:
async extrato => {
  var data = appsmith.store.rubricas2;
  var rubrica_desc;
  data.some((e, idx) => {
    if (e.indexOf(extrato.id_rubrica) != -1) {
      var aux = data[idx].label;
      rubrica_desc = data[idx].label.substr(aux.indexOf('- ') + 2);
      return true;
    }
  });
  await showAlert(rubrica_desc);
  return {
    "id": extrato.id,
    "tipo_mov": extrato.id_movimentacao,
    "id_projeto": extrato.id_projeto,
    "Rubrica": extrato.id_rubrica,
    "Data": extrato.data,
    "Valor": extrato.valor,
    "Favorecido": extrato.id_favorecido,
    "Tag": extrato.id_tag,
    "obs": extrato.observacao
  };
}

